import React, { useEffect, useState } from "react"

const Subscription = () => {

  const [prods, setProds] = useState([])

  const fetchProdData = () => {
    fetch("https://localhost:7028/api/Product")
      .then(response => {
        return response.json()
      })
      .then(data => {
        setProds(data)
      })
  }

  useEffect(() => {
    fetchProdData()
  }, [])

  return (
    <div>
      {prods.length > 0 && (
        <ul>
          {prods.map(prod => (
            <li key={prod.ProductId}>{prod.Name}</li>
          ))}
        </ul>
      )}
    </div>
  );
};

export default Subscription;
